"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: How to use your dry powder inhaler (adults) (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/how-to-use-your-dry-powder-inhaler-adults-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H16518135\">",
"      <span class=\"h1\">",
"       Are there different types of dry powder inhalers?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. There are 2 main types of dry powder inhalers (",
"      <a class=\"graphic graphic_picture graphicRef67084 \" href=\"UTD.htm?0/19/306\">",
"       picture 1",
"      </a>",
"      ):",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Single-dose inhalers",
"       </li>",
"       <li>",
"        Multiple-dose inhalers",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      The directions for the 2 types of dry powder inhalers are slightly different.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H16518142\">",
"      <span class=\"h1\">",
"       How do I use my dry powder inhaler?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Each dry powder inhaler has its own directions. Your doctor or nurse will show you how to use your inhaler. &nbsp;",
"     </p>",
"     <p>",
"      In general, these are the steps for using a dry powder inhaler:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Open the inhaler or take off the cover",
"       </li>",
"       <li>",
"        Load a dose of medicine:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        For single-dose inhalers, you load a dose by taking a pill out of its packaging and putting the pill into the inhaler. Then you need to push 1 or more buttons on the inhaler to poke holes in the pill.",
"       </li>",
"       <li>",
"        For multiple-dose inhalers, you load a dose by sliding a lever or twisting the bottom (or another part) of the inhaler.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Hold your inhaler in the correct position &mdash; Some inhalers need to be held upright, but others need to be horizontal. Multiple-dose inhalers usually need to be horizontal.",
"       </li>",
"       <li>",
"        Breathe out normally&mdash;but",
"        <strong>",
"         not",
"        </strong>",
"        into the inhaler",
"       </li>",
"       <li>",
"        Put your mouth on the mouthpiece",
"       </li>",
"       <li>",
"        Breathe in quickly and steadily, and as deeply as possible",
"       </li>",
"       <li>",
"        Remove your mouth from the mouthpiece and hold your breath for 5 to 10 seconds",
"       </li>",
"       <li>",
"        Let your breath out&mdash;but",
"        <strong>",
"         not",
"        </strong>",
"        into the inhaler",
"       </li>",
"       <li>",
"        For single-dose inhalers, open the inhaler, take out the used pill, and throw it away",
"       </li>",
"       <li>",
"        If you are supposed to take 2 puffs of your inhaler, load another dose and breathe it in",
"       </li>",
"       <li>",
"        Close your inhaler or replace the cover or cap",
"       </li>",
"       <li>",
"        Rinse your mouth out with water, gargle, and spit out the water",
"       </li>",
"       <li>",
"        Store your inhaler in a cool, dry place",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H16518149\">",
"      <span class=\"h1\">",
"       Do I need to clean my inhaler?",
"      </span>",
"      &nbsp;&mdash;&nbsp;No. Do",
"      <strong>",
"       not",
"      </strong>",
"      wash a dry powder inhaler with water or put it under water. If the mouthpiece gets dirty, you can wipe it with a dry cloth.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H16518156\">",
"      <span class=\"h1\">",
"       How do I know when my inhaler is empty?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Many dry powder inhalers come with a built-in dose counter. A counter keeps track of how many doses are left in your inhaler.",
"     </p>",
"     <p>",
"      When the counter reads 0 (zero), it&rsquo;s time to throw out the inhaler because it has no more medicine in it. Make sure to have another inhaler on hand before the counter reads 0.",
"     </p>",
"     <p>",
"      If your inhaler doesn&rsquo;t have a built-in counter, you need to keep track of the number of doses left in your inhaler. Based on how often you use your inhaler, you can figure out when you will need a refill and write this date down.",
"     </p>",
