var title_f9_47_9981="Anaphylaxis treatment in pregnant women";
var content_f9_47_9981=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F87553&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F87553&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Rapid overview: Emergent management of anaphylaxis in pregnant women",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Diagnosis is made clinically:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The most common signs and symptoms are cutaneous (eg, sudden onset of generalized urticaria, angioedema, flushing, pruritus). However, 10 to 20 percent of patients have no skin findings.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         <span style=\"color: #ff0000;\">",
"          Danger signs: Rapid progression of symptoms, respiratory distress (eg, stridor, wheezing, dyspnea, increased work of breathing, persistent cough, cyanosis), hypotension, dysrhythmia, chest pain, collapse",
"         </span>",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Acute management:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The first and most important therapy in anaphylaxis is epinephrine. There are",
"        <strong>",
"         NO absolute contraindications",
"        </strong>",
"        to epinephrine in the setting of anaphylaxis.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Airway:",
"        </strong>",
"        Immediate intubation if evidence of impending airway obstruction from angioedema; delay may lead to complete obstruction; intubation can be difficult and should be performed by the most experienced clinician available; cricothyrotomy may be necessary",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Call for help. This might involve a multispecialty resuscitation team (anesthesiologist, obstetrician, neonatologist) in a hospital setting or emergency medical services in a community setting.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Promptly and simultaneously, give:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <strong>",
"         IM Epinephrine (1 mg/mL preparation):",
"        </strong>",
"        Give epinephrine 0.3 to 0.5 mg intramuscularly, preferably in the mid-anterolateral thigh; can repeat every 5 to 15 minutes as needed. If symptoms are not responding to epinephrine injections, prepare IV epinephrine for infusion (see below).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <strong>",
"         Oxygen:",
"        </strong>",
"        Give 6 to 8 liters per minute via face mask, or up to 100 percent oxygen as needed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Place the woman on her left side (or in a position of comfort if there is respiratory distress and/or vomiting), and elevate her lower extremities. Manual displacement of the gravid uterus to the left might be necessary. Positioning on the back might lead to inferior vena caval compression and reduced venous return to the heart. Fatality can occur within seconds if she stands or sits suddenly.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <strong>",
"         Normal saline rapid bolus:",
"        </strong>",
"        Treat hypotension with rapid infusion of 1 to 2 liters IV; repeat as needed; massive fluid shifts with severe loss of intravascular volume can occur",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Start continuous electronic monitoring of maternal blood pressure, cardiac rate and function, respiratory status, and oxygenation and start continuous electronic fetal monitoring. If continuous electronic monitoring is not available, monitor maternal vital signs and fetal heart rate every five minutes or more frequently. Maintain a minimum maternal systolic blood pressure of 90 mmHg.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Also consider administration of:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <strong>",
"         Albuterol:",
"        </strong>",
"        For bronchospasm resistant to IM epinephrine, give 2.5 to 5 mg in 3 mL saline via nebulizer; repeat as needed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <strong>",
"         H1 antihistamine:",
"        </strong>",
"        Consider giving diphenhydramine 25 to 50 mg IV (for relief of urticaria and itching only)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <strong>",
"         H2 antihistamine:",
"        </strong>",
"        Consider giving ranitidine 50 mg IV",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <strong>",
"         Glucocorticoid:",
"        </strong>",
"        Consider giving methylprednisolone 125 mg IV",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        When indicated at any time, perform emergency cesarean delivery for anaphylaxis refractory to medical management as outlined above or for fetal distress",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Simons FE, Schatz M. Anaphylaxis during pregnancy. J Allergy Clin Immunol 2012; 130:597.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
